Adventure Time - Marceline and the Scream Queens 01-06 (2012, Digital, Minutemen-InnerDemons)

Promotional info for the hardcover edition - &quot;Thanks to a newfound interested in rock n' roll, Princess Bubblegum volunteers to manage Marceline's paranormal rock band for a pivotal tour across the land of Ooo! But when the band is threatened by everything from snobby scenesters to beasts born of self-doubt, can they hold it together and make it to the RADDEST GIG EVER in time, and manage to stay friends throughout the process?&quot;

These are the Minutemen high-res digital copies; there are also Empire versions posted as well. Thanks to the scanners for their efforts; please seed and enjoy. 

